import React from "react"
import Link from "next/link"

import "./layout.css";

class Layout extends React.Component {
    constructor(props) {
        super(props);
        this.state = { };
    }

    render() {
        return (
            <main>
                <nav>
                    <ul>
                        <Link href="/">
                            <a style={{ fontSize: 20 }}>Home</a>
                        </Link>
                        <Link href="/about">
                            <a style={{ fontSize: 20 }}>About</a>
                        </Link>
                    </ul>
                </nav>
                {this.props.children}
            </main>
        );
    }
}

export default Layout;
